import React, { Component } from 'react';
import { Route } from 'react-router';
import Home from './components/Home';

export default class App extends Component {
    displayName = App.name

    render() {
        return (
            <div class="flex">
                {/* <header>
                    <div class="mc-container">
                        <h1><span class="logo"> MC </span><span class="name">Money Clip</span></h1>
                    </div>
                    <div class="main-navigation">
                        <ul>
                            <li><a href="/" class="link"><i class="fas fa-tachometer-alt"></i>Dashboard</a>
                            </li><li><a href="/Incomes" class="link"><i class="far fa-money-bill-alt"></i> Income</a></li>
                        </ul>
                    </div>
                </header> */}
                <main>
                    <Route exact path='/' component={Home} />
                    <div class="mc-container">
                        <h1>Dashboard</h1>
                        <div class="total-income">
                            Current Income: $4,000.25
                        </div>
                    </div>

                </main>
            </div>


        );
    }
}
